styles:
.modalIcon .showClearButton {
    display: none;
}
.modalIcon:hover .allowClear.showClearButton {
    display: block;
}
.modalIcon input {
    padding-right: 30px;
}
.modalIcon .moreIcon {
    position: absolute;
    top: 6px;
    right: 6px;
    cursor: pointer;
    font-size: 16px;
    color: #758a96;
}
.modalIcon .clearIcon {
    position: absolute;
    top: 5px;
    right: 30px;
    cursor: pointer;
    font-size: 19px;
    color: #758a96;
}
